import './Home.css';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import NavBar from '../NavBar/NavBar';

function Home() {
    const toDashboard = () => {
        useNavigate('/dashboard');
    }

    return (
        <div className='Home'>
            <NavBar />
            <div className='home-content'>
                <h1> Welcome to the Experience Finder! </h1>
                <div className='home-info'>
                    <h2> Discover hidden Experiences from the Roblox platform </h2>
                    <button onClick={toDashboard()} className='dashboard-button'>
                        Explore now
                    </button>
                </div>
            </div>
        </div>
    );
}

export default Home;
